sys_variable_value.value:
(function execute(inputs, outputs) {
  var uiAction = new GlideRecord("sys_ui_action");
  uiAction.addQuery("action_name", "data_mining_ops");
  uiAction.addQuery("table", inputs['table_name']);
  uiAction.addQuery("list_banner_button", true);
  uiAction.setLimit(1);
  uiAction.query();
  if(uiAction.next()){
    uiAction.deleteRecord();
    outputs['disableresult'] = "passed";
  }else{
    outputs['disableresult'] = "failed";
  }

  var fieldsToModify = [];
  var fields = new GlideRecord("sys_dictionary");
  var choices = new GlideRecord("sys_choice");
  choices.addQuery("name", inputs['table_name']);
  choices.addQuery("hint", "Custom DM Choice");
  choices.query();
  while(choices.next()){
    if(!fieldsToModify.toString().includes(choices.element)){
       fieldsToModify.push(choices.getValue('element'));
    }
    choices.deleteRecord();
  }

  for(var i in fieldsToModify){
    fields.initialize();
    fields.addQuery("name", inputs['table_name']);
    fields.addQuery("element", fieldsToModify[i]);
    fields.query();
    fields.next();
    fields.choice = '';
    fields.update();
  }
})(inputs, outputs);

